    false,nt"url": null,nt"notes": "This Water Resource Inventory and Assessment
    (WRIA) Summary Report for Hamden Slough National Wildlife Refuge (NWR) describes
    current hydrologic information, provides an assessment of water resource needs and
    issues of concern, and makes recommendations regarding Refuge water resources. This
    Summary Report synthesizes a more comprehensive compilation of water resource data
    contained in the national interactive online WRIA database. The information contained
    within this report and supporting documents will be entered into the national database
    for storage, online access, and consistency with future WRIAs. The document is intended
    to be a reference for ongoing water resource management and strategy development.
    This is not meant to be exhaustive or a historical summary of activities at Hamden
    Slough NWR.  The WRIA is a reconnaissance-level effort intended to inventory and
    assess water rights, water quantity, water quality, water management, climate, and
    other water resource issues for each refuge. The long term goal of the National
    Wildlife Refuge System (NWRS) WRIA effort is to provide up-to-date, accurate data
    on Refuge System water quantity and quality in order to acquire, manage, and protect
    adequate supplies of water.",nt"license_title": "License Not Specified",nt"extras":
